import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Home from './components/Home';
import Profile from './components/Profile';
import Layout from './components/Layout';
import Dashboard from './components/Dashboard';
import StockPage from './components/StockPage';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/home" element={<Home />} />
        <Route path="/profile" element={<Profile />} />

        {/* Layout Routes */}
        <Route path="/dashboard" element={
          <Layout>
            <Dashboard />
          </Layout>
        } />
        <Route path="/stock" element={
          <Layout>
            <StockPage />
          </Layout>
        } />
        <Route path="/add-stock" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Add Stock</h1>
              <p className="text-gray-600">Add new medicines to inventory</p>
            </div>
          </Layout>
        } />
        <Route path="/report" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Reports</h1>
              <p className="text-gray-600">View pharmacy reports and analytics</p>
            </div>
          </Layout>
        } />
        <Route path="/fintrack" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Financial Tracking</h1>
              <p className="text-gray-600">Track pharmacy finances and revenue</p>
            </div>
          </Layout>
        } />
        <Route path="/todo" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Todo</h1>
              <p className="text-gray-600">Manage tasks and reminders</p>
            </div>
          </Layout>
        } />
        <Route path="/staff" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Staff Management</h1>
              <p className="text-gray-600">Manage pharmacy staff and roles</p>
            </div>
          </Layout>
        } />
        <Route path="/setting" element={
          <Layout>
            <div className="space-y-6">
              <h1 className="text-2xl font-bold text-gray-900">Settings</h1>
              <p className="text-gray-600">Configure pharmacy settings</p>
            </div>
          </Layout>
        } />

        <Route path="/" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
